svg.script:

  //  

 var gstat=null;
 var gwait=null;

 function sst(txt,nice)
  {
   if (gwait!=null) return;
   if (nice!=1) { gstat=txt; gwait=1; setTimeout("sfree()",500); }
   else { if (!gwait) gstat=txt; else return };
   try{window.status=gstat; setTimeout("dsst()",5); }catch(e){};
  }

 function dsst()
  { try{window.status=gstat;}catch(e){}; }

 function sfree()
  { gwait=null; }

 // TODO, fix with varnames.
 try{var awt=350;
     var afit=600;
     var ausf=1;
     var aactv=0;
     var atm=0;
     var atmi=40;
    }catch(e){}

 function aon(evt,txt,id)
 {
  try{

  var bla=parseFloat(0.400000000000);
  if (!txt)
   {
    try{
    var nid=document.getElementById(id);
    var txt=nid.getAttribute("desc");
       } catch(e){return;}
    if (!txt) return;
   }
  sst(txt);
  var x=evt.clientX;
  var y=evt.clientY;
  var tid=document.getElementById("LDBMFq-tan");
  try{tid.getFirstChild.setData(txt);}catch(e){tid.firstChild.data=txt;}
  var fns=parseInt(tid.getAttribute("font-size"));
  tid.setAttribute("opacity","1");
  y+=fns*2; x+=fns;
  var ty=parseFloat(y+(bla-0.5000)*fns); var tx=x;
  var ry=parseFloat(y-(fns*1.150)); var rx=parseFloat(x-(fns/2.000));
  try{tlen=tid.getComputedTextLength();}catch(e){tlen=tid.getBBox().width}
  var rid=document.getElementById("LDBMFq-ran");
   //TODO Move this out
   rid.setAttribute("stroke-width", parseFloat(fns/25));
  rid.setAttribute("opacity",".85");
  rid.setAttribute("x",rx);
  rid.setAttribute("y",ry);
  rid.setAttribute("height",parseFloat(fns*1.300));
  rid.setAttribute("width",parseFloat(tlen+1.000*fns));
  tid.setAttribute("x",tx);
  tid.setAttribute("y",ty);
  var gan=document.getElementById("LDBMFq-gan");
  gan.setAttribute("opacity",0);
  aactv=1;atm=0;anfi();
 }catch(e){return}
 };



 function aof(evt){
 sst(" ",1);
 try{
  var tid=document.getElementById("LDBMFq-tan");
  try{tid.getFirstChild.setData(" ");}catch(e){tid.firstChild.data=" ";}
  tid.setAttribute("opacity",0);
  var rid=document.getElementById("LDBMFq-ran");
  rid.setAttribute("opacity",0);
  var gid=document.getElementById("LDBMFq-gan");
  gid.setAttribute("opacity","0");
  aactv=0;atm=0;
  }catch(e){return}
 }


 function anfi(){
 try{
 if(ausf==0)
  {aactv=0;
   atm=0;
   var gid=document.getElementById("LDBMFq-gan");
   gid.setAttribute("opacity","1");
   return};
 if(aactv==0)return;
 atm+=atmi;
 if(atm<awt){setTimeout("anfi()",atmi);return;}
 if(atm>(afit+awt))return;
 opf=(atm-awt)/afit;
 var gid=document.getElementById("LDBMFq-gan");
 gid.setAttribute("opacity",opf);
 setTimeout("anfi()",atmi)}catch(e){return}
 };


 function dz()
 {
  aof();
  try
   {
    var de=document.documentElement;
    var newtx = -(parseFloat(de.currentTranslate.x/de.currentScale));
    var newty = -(parseFloat(de.currentTranslate.y/de.currentScale));
    var tbx="0"; var tby="0";
    var ntbx=parseFloat(newtx+tbx/de.currentScale);
    var ntby=parseFloat(newty+tby/de.currentScale);
    try
     {
      var n=document.getElementById("tk");
      n.setAttribute("transform", "translate("+ntbx+","+ntby+") scale("+(1.0000/de.currentScale)+")");
     }catch(e){};
    try
     {
      var n=document.getElementById("LDBMFq-gan");
      n.setAttribute("transform", "translate("+ntbx+","+ntby+") scale("+(1.0000/de.currentScale)+")");
     }catch(e){};
   } catch(e){return}
  };

