var gLS1= parseFloat(.06064453125);var gLS1o= gLS1;


    var gLSM1= parseFloat(15);
    var gLSM1o= gLSM1;
    var gLSMH1= parseFloat();
    var gLSMH1o= gLSMH1; 


 function mi1(id,evt,atxt,gtype)
{


 try{

  var P,PID,PE;
  try{P=evt.target;PID=P.getAttribute("id")}catch(e){};
  if(PID!=id){PID=id;P=document.getElementById(id)};

  switch (gtype)
   {
   case 3:
    {

P.setAttribute("fill","palegreen");
break;
    }

   case 2:
    {
break;
    }

   case 1:
    {
P.setAttribute("fill","palegreen");

    break;
    }

   default: break;
   }

aon(evt,atxt,id);
 }catch(e){return}

 };


 function mo1(id,evt,gtype)
{
 try{

  var P,PID,PE;
  try{P=evt.target;PID=P.getAttribute("id")}catch(e){};
  if(PID!=id){PID=id;P=document.getElementById(id)};

  switch (gtype)
   {
   case 3:
    {

P.setAttribute("stroke-width","15");
P.setAttribute("fill","papayawhip");
break;
    }

   case 2:
    {
break;
    }

   case 1:
    {
P.setAttribute("fill","papayawhip");

    break;
    }

   default: break;
   }

aof(evt);
 }catch(e){return}

 };
